import React, { Component } from 'react';

import {
  View,
  Text,
  Platform,
  TextInput
} from 'react-native';

export default class CustomComponent extends Comment{
    static propTypes = {
        Text :String,
    }

    render(){
        return(
            <View><Text>{this.props.Text}</Text></View>
        )
    }

}
